import { IonButton, IonContent, IonFooter, IonHeader, IonImg, IonLabel, IonPage, IonTitle, IonDatetime } from '@ionic/react';
import React, { useEffect, useState } from 'react';
import Logo from '../imagenes/Logo.png';
import './Home.css';

function Home () {

    const [selectedDate, setSelectedDate] = useState('');

    const handleDateChange = (event) => {
        setSelectedDate(event.target.value);
      };

    const handleClick = () => {
        console.log('Fecha seleccionada:', selectedDate);
    };  

  return (
    <IonPage>
      <IonContent fullscreen className='fondo'>

        <IonDatetime presentation='time' value={selectedDate} onIonChange={handleDateChange}></IonDatetime>
        <IonButton onClick={handleClick}>Guardar</IonButton>

      </IonContent>
    </IonPage>
  );
};

export default Home;
